import React from "react";
import landingVideo from "./landing-video.mp4";
// import logo from "../oke-logo/Logo.svg"
import "./LandingPage.css";
import Typical from "react-typical";

const LandingPage = () => {
  return (
    <div className="header">
      <video autoPlay loop muted className="video">
        <source src={landingVideo} type="video/mp4" />
      </video>
      <p>logo</p>
      <div>
        <h1 className="texts">Hello. I'm Okeowo Oluwadarasimi David</h1>
        <p className="texts">
          I'm a {''} 
          <Typical
            loop={Infinity}
            wrapper="b"
            steps={[
              "software developer",
              1000,
              "student",
              1000,
              "Quick learner",
              1000,
              "Someone's boyfriend",
              1000,
            ]}
          />
        </p>
      </div>
    </div>
  );
};

export default LandingPage;
